import React from'react'; 

const Doggy =()=>{
    const[dog, setDog] =React.useState([]);

    React.useEffect(() => {
        const Type="borzoi";

        fetch(
            `https://dog.ceo/api/breed/${Type}/images`
            )
        .then((res)=>res.json())
        .then((json)=>{
            setDog(json.resulets); 
        })

    },[]);

    return (
        <div className="dog">
            {dog.map((item)=>(
                <div key={item.id}>
                <img
                width="200"
                src={`https://image.tmdb.org/t/p/w1280${item.poster_path}`}
                    />
                </div>

            ))}

        </div>
    );


};
export default Doggy;
